// --- Drawing Functions (Individual Elements) ---
// Name: text_1
void draw_text_1(TFT_eSPI &tft)
{
    tft.setTextSize(2);
    tft.setTextColor(0x0408);
    tft.drawString("Memoria Interna OK", 3, 106);
}

// Name: text_2
void draw_text_2(TFT_eSPI &tft)
{
    tft.setTextSize(2);
    tft.setTextColor(0x209D);
    tft.drawString("Texto com imagens", 11, 8);
}

// Name: text_3
void draw_text_3(TFT_eSPI &tft)
{
    tft.setTextSize(2);
    tft.setTextColor(0x9A56);
    tft.drawString("Decida oque exibir", 5, 30);
}

// Name: text_4
void draw_text_4(TFT_eSPI &tft)
{
    tft.setTextSize(1);
    tft.setTextColor(0x841F);
    tft.drawString("Voce pode editar isso", 46, 51);
}

// Name: ram
void draw_img_2_ram_png(TFT_eSPI &tft)
{
    tft.pushImage(95, 68, 40, 40, img_2_ram_png_data, 0xF81F);
}

// --- Main Drawing Function (All Elements) ---
void drawLayout(TFT_eSPI &tft)
{
    draw_text_1(tft);
    draw_text_2(tft);
    draw_text_3(tft);
    draw_text_4(tft);
    draw_img_2_ram_png(tft);
}
